import React from "react";
import Button from "../Button/Button";
import "./Card.css";

const Card = (props) => {
  console.log(">>>", props);
  return (
    <div className="card">
      <div className="container-2">
        <img src={"https://placeimg.com/300/200/people"} alt="people" />
        <span>ver detalhes</span>
      </div>

      <div class="parent">
        <div class="div1">
          <span>tempo restante</span>
          <span>{props.remainingTime}</span>
        </div>
        <div class="div2">
          <span>Ãºltima oferta</span>
          <div class="divider"></div>
          <span>{props.amount}</span>
        </div>
        <div class="div3"> {props.model}</div>
        <div class="div4">{props.year}</div>

        <div class="div5">
          <span>{props.km}</span>
          <div class="divider"></div>
        </div>
        <div class="div6">
          <Button />
        </div>
      </div>
    </div>
  );
};

export default Card;
